const data = (state = [], action) => {
  switch (action.type) {
    case "FETCH_DATA":
      return [...action.payload];
    case "SELECT_SEAT":
      return {
        ...state,
        [actio]: state.locations.ma((e)=>console.log(e))
        
      };
    default:
      return state;
  }
};

export default data;
